import React, {useState} from 'react';

const MyComponent = () => {
    const [name, setName] = useState({

        country: "Bangladesh"
    })


    return (
        <div>
            <h1>{name.country}</h1>
            <button onClick={()=>setName()}>Change</button>
        </div>
    );
};

export default MyComponent;
